import React from 'react';
import './App.css';
import { useTranslation } from 'react-i18next';
import Navbar from './components/navbar.js';
import Homepage from './components/homepage.js';

function App() {
  const { t, i18n } = useTranslation();

  return (
    <div className="App">
      <Navbar />
      <Homepage />
    </div>
  );
}

export default App;
